description:
1244 High Resolution Icons for a large array of popular programs. It took me a while to gather up these and meticulously categorize these rare icons. And, I actually made a few of them myself.

In addition to icons for programs, there are icons for hardware, musical instruments, fruit, clothing, video game systems and much much more.

Nothing is below 128x128 and many are 512x512 resolution. All files are in PNG format.


You can check out a sample here: &lt;a href=&quot;
